'use strict';

var GrafanaPage = require('./GrafanaPage.js');

class PluginConfigPage extends GrafanaPage.GrafanaPage {
  constructor(ctx, args) {
    super(ctx, args);
    this.ctx = ctx;
    this.args = args;
  }
  /**
   * Navigates to the app plugin config page.
   */
  goto(options) {
    const url = this.ctx.selectors.pages.Plugin.url(this.args.pluginId);
    return super.navigate(url, options);
  }
}

exports.PluginConfigPage = PluginConfigPage;
